Step 1: Reasoning

• Key Psychological Mechanisms:  
 – Self-interest motives lead proposers to maximize the share of the pot they keep.  
 – Fairness concerns drive proposers to offer an amount close to what is “deserved” by the opponent based on their relative contributions (tokens found).  

• Interaction of Mechanisms:  
 A proposer faces a trade‐off between keeping a larger part of the combined earning and adhering to a fairness norm. In our task the fairness standard is derived from the ratio of opponent’s tokens to the total tokens (token_opp/(token_self+token_opp)), which, when expressed in percentage (multiplied by 100), represents the “fair” offer to the opponent. Deviation from this fairness level is penalized in the utility.

• Mathematical Form:  
 Let the chosen action be the offered percentage to the opponent, denoted by proposed_perc. The monetary gain for the proposer is proportional to the retained percentage (100 – proposed_perc) and the combined_earning. A fairness penalty is imposed as the squared difference between the actual offer (proposed_perc) and the fairness norm computed as:  
  fair_offer = (token_opp/(token_self + token_opp)) × 100.  
 Thus, the overall utility is a weighted self‐interest term minus a penalty term for deviating from fairness.

• Needed Parameters:  
 We introduce two learnable parameters:  
  ψ (psi): scales the weight on the self‐interested monetary gain.  
  θ (theta): scales the penalty on deviation from the fairness norm.  

• Mapping to Observed Data:  
 – combined_earning: total pot available.  
 – token_self, token_opp: determine the fair share (fair_offer) for the opponent.  
 – proposed_perc: observed proposed share to the opponent (action variable).  
 – The utility computed U will be used (subsequently paired with an exogenous temperature parameter) to generate choice probabilities. Only proposer behavior (trial_role = 2) is modeled.

Below is the formal specification.

<MODEL>
U_action = psi * combined_earning * (1 - proposed_perc/100) - theta * (proposed_perc - (token_opp/(token_self + token_opp))*100)^2
</MODEL>

